import React from 'react';
import { motion } from 'framer-motion';
import {fadeIn} from '../variants';
import Img1 from '../assets/portfolio-img1.png'
import Img2 from '../assets/portfolio-img2.png'
import Img3 from '../assets/portfolio-img3.png'

const Work = () => {
  return (
    <section className="section" id="work">
      <div className="container mx-auto">
        <div>
          <div>
            {/* text */}
            <div>
              <h2 className="h2 leading-tight text-accent">My works</h2>
              <p className=' max-w-sm mb-16'>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Rem
                aliquam aut velit consectetur id quaerat sunt expedita
                necessitatibus perspiciatis porro error vitae doloremque
                incidunt magnam fugiat laudantium delectus ad, optio tenetur
                repellendus! Sunt, aliquid laborum.
              </p>
              <button className='btn btn-sm'>View all projects</button>
            </div>
            {/* img */}
            <div>
              {/* overlay */}
              <div></div>
              {/* img */}
              <img src={Img1} alt="1" />
              {/* pretitle */}
              <div>UI/UX Design</div>
              {/* title */}
              <span>Project Title</span>
            </div>
          </div>
          <div>1</div>
        </div>
      </div>
    </section>
  );
};

export default Work;
